import styles from './Header.module.css'
import HeaderMenuItem from "../HeaderMenuItem/HeaderMenuItem";
import {headerMenuItems} from "../../utils/vars";
import {ivincoProjectFunction} from "../../utils/utils";

const Header = () => {
    const testItem = headerMenuItems[0]

    return (
        <>
            <div className={styles.logo}></div>
            <ul>
                <HeaderMenuItem item={{name: 'Project',buttons:[{name: 'Ivinco', onClickFunction: ivincoProjectFunction}]}}/>
            </ul>
            <div className={`${styles.avatar} ${styles.avatar_unknown}`}></div>
        </>
    )
}

export default Header;
